const App = () => {
  const categories = [
    { id: 1, title: "Hat" },
    { id: 2, title: "Clothing" },
  ];

  return (
    <div>
      {categories.map(({ title }) => {
        return (
          <div className="category-container">
            <div className="background-image">
              <div className="category-body-container">
                <h1>{title}</h1>
                <p>Shop Now</p>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default App;
